import React from 'react';
import { HeaderArea } from './styled';
import { Link } from 'react-router-dom';

const Header = () => {
    return (
        <HeaderArea>
            <div className="container">
                <div className="logo">
                    <Link to="/">
                        <img alt="logo MBS" className="mbs-logo" src="https://i.imgur.com/AV0gElN.png" />
                    </Link>
                </div>
                <nav>
                    <ul>
                        <li>
                            <Link></Link>
                        </li>
                    </ul>
                </nav>
            </div>
        </HeaderArea>
    );
}

export default Header;
